class Solution {
  int beautifulSubstrings(String s, int k) {
    int n = s.length;
    int result = 0;
    Map<int, List<int>> prefixSum = {0: [-1]};

    for (int i = 0, vowels = 0, consonants = 0; i < n; i++) {
      if ('aeiou'.contains(s[i])) {
        vowels++;
      } else {
        consonants++;
      }
      int diff = vowels - consonants;

      prefixSum.putIfAbsent(diff, () => []);
      for (var index in prefixSum[diff]!) {
        int v = vowels - (index == -1 ? 0 : vowels - (index + 1 >= vowels ? 0 : vowels - (index + 1)));
        int c = consonants - (index == -1 ? 0 : consonants - (index + 1 >= consonants ? 0 : consonants - (index + 1)));
        if ((v * c) % k == 0) {
          result++;
        }
      }
      prefixSum[diff]!.add(i);
    }

    return result;
  }
}
